  return <>
    <div
      style={{
        ...style,
        display: "flex",
        flexDirection: "column",
        cursor: "pointer",
        marginLeft: {deep}
      }}
      onClick={() => {
        console.log(name)
      }}
    >
      {name}
    </div>
    {file.type === `folder` ? <>
      {Object.entries(file).map(([key, value]) => {
        console.log(key, value)
        if(key === `type`) {
          return
        }
        return <File
          file={value}
          name={key}
          key={key}
          deep={deep + 8}
        />
      })}
    </> : <></>}
  </>
}
